const Launches = () => {

    const shoes = [{
        name: 'Crossover Brogues',
        img: 'crossover-brogues.png',
        price: 'Rs 2,699'
    },
    {
        name: 'Luxe Brogues',
        img: 'luxe-brogues.png',
        price: 'Rs 2,999'
    },
    {
        name: 'The Derbies',
        img: 'derbies.png',
        price: 'Rs 2,999'
    },
    {
        name: 'Light Trainers',
        img: 'trainers.png',
        price: 'Rs 1,999'
    }
    ]

    return (
        <div className="shoes">
            <p className="shoeHeading">New Launches</p>

            <div className="shoeCards">
                {shoes.map((shoe, index) => (
                    <div key={index} className="shoe">
                        <img className="shoeImg" src={shoe.img}></img>
                        <div className="shoeDescription">
                            <p>{shoe.name}</p>
                            <p>{shoe.price}</p>
                            <div className="addCart">
                            <button>ADD TO CART</button>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Launches;
